import styled from '@emotion/styled';
import { Box, Paper, Stack, Typography } from '@mui/material'
import React from 'react'

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:"40px",
  }));

const Login = () => {
  return (
    <Stack bgcolor="white" display="flex" direction="row" justifyContent="center" sx={{
        marginTop:6,
        marginBottom:6,
    }}>
        <DemoPaper elevation={6}>
            <Stack display="flex" direction="row" justifyContent="space-between">
                <Box bgcolor="GrayText" flex="50%" sx={{
                    height:800
                }}>
                    <Typography variant="h3">Login Form</Typography>
                </Box>
                <Box bgcolor="wheat" flex="50%" sx={{
                    height:800,
                    borderTopLeftRadius:"40px"
                }}>Image</Box>
            </Stack>

        </DemoPaper>
    </Stack>
  )
}

export default Login
